import React, { Component } from "react";
class Count extends Component {
  state = {
    count: 2,
    Tags: ["tag1", "tag2", "tag3", "tag4"],
  };

  render1() {
    let { Tags: coxz } = this.state.Tags;
    coxz.length === 0 ? (
      <h1>nothing to show</h1>
    ) : (
      coxz.map((tag) => <li key={tag}>{tag}</li>)
    );
    return coxz;
  }
  render2() {
    if (this.state.Tags.length === 0) return <h1>nothing to show</h1>;
    return this.state.Tags.map((tag) => <li key={tag}>{tag}</li>);
  }

  render() {
    return (
      <React.Fragment>
        <ul>{this.render1()}</ul>
        {/* <button className="btn btn-warning">incriment</button> */}
      </React.Fragment>
    );
  }
}

export default Count;
